import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';

function Footer() {
    return (
        <header>
            <a href="https://github.com/jacobmca"><FontAwesomeIcon icon="fa-brands fa-github" /></a>
            <a href="https://www.linkedin.com/in/jacob-mcauliffe-5340b641/"><FontAwesomeIcon icon="fa-brands fa-linkedin" /></a>
            <a href="https://www.youtube.com/channel/UCBezQ45HXl20AC5FLeecCAw"><FontAwesomeIcon icon="fa-brands fa-youtube" /></a>
        </header>
    )
}

export default Footer;
